import React, { useState } from 'react';
import axios from 'axios';
import './header.css';
import logo from '../../imagenes/logo.png';

const Header = ({ handleFormVisibilityRegistro, handleFormVisibilityInicioSesion }) => {
  const [searchQuery, setSearchQuery] = useState('');

  const handleSearchChange = (event) => {
    setSearchQuery(event.target.value);
  };

  const handleSearchSubmit = async (event) => {
    event.preventDefault();

    try {
      const apiKey = '83bc0d3d812780eff004a2baed4eaf17';
      const response = await axios.get(
        `https://api.themoviedb.org/3/search/movie?api_key=${apiKey}&query=${searchQuery}`
      );

      const movies = response.data.results;
      console.log('Películas encontradas:', movies);
      // Aquí puedes realizar las acciones necesarias con las películas encontradas
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <header>
      <div className="logoDiv">
        <img className="logoHeader" src={logo} alt="Logo" />
      </div>

      <form onSubmit={handleSearchSubmit} className="input-group">
        <input
          type="text"
          className="form-control input-lg"
          aria-label="Recipient's username"
          aria-describedby="button-addon2"
          value={searchQuery}
          onChange={handleSearchChange}
        />
      <button className="btn btn-outline-secondary btn-lg" type="button" onClick={handleDetailsVisibility}>
  Buscar
</button>
      </form>

      <div className="login">
        <a className="dropbtn">Iniciar sesión / Registrarse</a>
        <div className="login-content">
          <button onClick={handleFormVisibilityInicioSesion}>Inicio</button>
          <button onClick={handleFormVisibilityRegistro}>Registrarse</button>
        </div>
      </div>
    </header>
  );
};

export default Header;
